import React from 'react';
import { Form, Button } from 'react-bootstrap';
import UseForm from './useForm';
import FormValidate from './formValidate';

function formSignIn({ submitForm }) {

    const { handleChange, values, handleSubmit, errors } = UseForm(submitForm, FormValidate);
    return (
        <Form onSubmit={handleSubmit} className="w-75 mx-auto mt-3">
            <Form.Group controlId="formName">
                <Form.Label htmlFor="username">Name</Form.Label>        
                <Form.Control type="text" id="username" placeholder="Enter name" name="username"   value={values.username}  onChange={handleChange}/>
                {errors.username && <p>{errors.username}</p>}
            </Form.Group>

            <Form.Group controlId="formEmail">
                <Form.Label htmlFor="useremail">Email address</Form.Label>
                <Form.Control type="email" id="useremail" placeholder="Enter email" name="useremail"   value={values.useremail}  onChange={handleChange}/>
                {errors.useremail && <p>{errors.useremail}</p>}
            </Form.Group>

            <Form.Group controlId="formPassword">
                <Form.Label htmlFor="userpass">Password</Form.Label>
                <Form.Control type="password" id="userpass" placeholder="Password" name="userpass"   value={values.userpass}  onChange={handleChange}/>
                {errors.userpass && <p>{errors.userpass}</p>}
            </Form.Group>

            <Form.Group controlId="formPasswordConfirm">
                <Form.Label htmlFor="userpassconf">Confirm Password</Form.Label>
                <Form.Control type="password" id="userpassconf" placeholder="Confirm Password" name="userpassconf"   value={values.userpassconf}  onChange={handleChange}/>
                {errors.userpassconf && <p>{errors.userpassconf}</p>}
            </Form.Group>
           
            <Button variant="primary" type="submit"> Submit </Button>
        </Form>
    )
}

export default formSignIn;
